import React from "react";
import { useContext } from "react";
import WeeklyInfoContext from "../../context/WeeklyInfoContext";

function BabyInfo() {
  const weeklyInfo = useContext(WeeklyInfoContext);

  return (
    <div>
      <p>Weight: {weeklyInfo?.babyInfo.weight}</p>
      <p>Height: {weeklyInfo?.babyInfo.height}</p>
      <p>General info: {weeklyInfo?.babyInfo.generalInfo}</p>
      <p>{weeklyInfo?.momInfo.exerciseInfo.briefInfo}</p>
    </div>
  );
}

export default BabyInfo;
